import React from "react";
import { Link } from "react-router-dom";
import "./index.scss";

function Menu() {
  return (
    <div>
      <ul className="menu">
        <li>
          <Link className="menu__item" to="/">
            Home
          </Link>
        </li>
        <li>
          <Link className="menu__item" to="/shop">
            Shop
          </Link>
        </li>
        <li>
          <Link className="menu__item" to="/blog">
            Blog
          </Link>
        </li>
      </ul>
    </div>
  );
}

export default Menu;
